import React from 'react';
import { Link } from "react-router-dom";

function Projects() {

  const adoculosData = {
    "title": "Lowering the barrier",
    "description": "Princeton senior thesis"
  }
  return (
    <div className="">

      <Link to={{
         pathname: "/projects/adoculos",
         state: adoculosData
        }}>
        AdOculos
      </Link>

    </div>
  );
}

export default Projects;
